import React from 'react';
import css from './donut.module.css';
import PieChart from 'react-minimal-pie-chart';


const donut = () => {
    return (
        <PieChart
            data={[
                
                { title: 'Two', value: 31.2, color: '#6A2135' },
                { title: 'Three', value: 16.4, color: '#C13C37' },
                { title: 'One', value: 52.4, color: '#E38627' }
            ]}
            lineWidth={20}
            animate
        />);
}

export default donut;
